import React from 'react';
import { Box, Typography, Grid, Paper, Card, CardHeader, CardContent, CardActions, makeStyles } from '@material-ui/core';
import { SectionHeading } from '../Component';
import { PricingData } from './PricingData';
import './Css/Pricing.scss'

const useStyles = makeStyles(theme => ({
    margin: { margin: "0 auto" }
}))

const Pricing = () => {
    const classes = useStyles();
    return (
        <>
            <Box my={5} className="pricingWrapper">
                <Grid container>
                    <Grid item lg={10} md={11} className={classes.margin}>
                        <Box>
                            <SectionHeading head="Our Pricing" />
                            <Box py={4}>
                                <Grid container spacing={5}>
                                    {PricingData.map((item, index) => {
                                        return (<>
                                            <Grid item lg={4} md={4} sm={4} xs={12}>
                                                <Paper>
                                                    <Card>
                                                        <CardHeader title={item.plan} />
                                                        <CardContent>
                                                            <Typography align="center" variant="h6">$<span className="display-6">{item.price}</span>/Website</Typography>
                                                            <Box py={2}>
                                                                <ul>
                                                                    {item.services.map((item, index) => {
                                                                        return (<>
                                                                            <li>{item}</li>
                                                                        </>)
                                                                    })}
                                                                </ul>
                                                            </Box>
                                                        </CardContent>
                                                        <CardActions>

                                                        </CardActions>
                                                    </Card>
                                                </Paper>
                                            </Grid>
                                        </>)
                                    })}
                                </Grid>
                            </Box>
                        </Box>
                    </Grid>
                </Grid>
            </Box>
        </>
    )
}

export default Pricing
